import './App.css'

const App = () => {
  const [stones, setStones] = useState([])

  useEffect(() => {
    console.log('effect');
    axios
    .get('http://localhost:3001/stones')
    .then(response => {
      console.log('promise fulfilled')
      setStones(response.data)
      })
  }, [])

  return (
    <div className="appContainer">
      <Header />
      <NavBar />
      <About />
      <StoneDisplay /* stones={stones} */ />
      <Contact />
    </div>
  )
}

export default App
